import React from 'react';

export class ItemViewerNav extends React.Component {
	
	constructor(props){
		super(props);
		
		
	}
	
	
	render(){
		
		const buttons = [];
		
		for(let i = 1; i <= this.props.n_pages; i++){
			let n = i.toString();
			pages.push(<Link to={n}> {n} </Link>)
		};
		
		return (
			<div>
				{buttons}
			</div>
		);
	}
}
